import React, { Component } from "react";
 
class Home extends Component {
  render() {
    return (
      <div>
        <p>
		Hello every one,	my name is Alexis uwimana I have Studied Electronics and Telecomunication Engineering in Kigali Instituets of Science and technology (KIST) 
		where i got a Bahelor of Science Degree in Enginering, I have graduated in 2011.
		From that time I m working as an IT Manager @ Nyamata District Hospital. 
		From October 2018 I started learning programming with Andela Learning Community (ALC_Rwanda) in partneship with OpenClassroom (online platform that offer online courses)
		I' am happy with it and i like programming 
	    </p>
      </div>
    );
  }
}
 
export default Home;
